import React from "react";
import Ul_li from "./Ul_Li";

function List() {
  return (
    <ul className="list-group">
        <img src='https://th.bing.com/th/id/OIP.8NYDtbLqraAquonpU0qb8QHaFj?w=206&h=180&c=7&r=0&o=5&pid=1.7'/>
      <Ul_li id="feacbook" text="Feacbook" for="for-Feacbook" />
      <Ul_li id="youtub" text="Youtub" for="for-Youtub" />
      <Ul_li id="telegram" text="Telegram" for="for-telegram" />

    </ul>
  );
}
export default List;
